import React from "react";

const Login = () => {
    return (
        <>
            <div id="login-form">
                帳號 : <input type="text" name="username" id="username"/><br/>
                密碼 : <input type="text" name="password" id="password"/>   
                <button onClick={() => {
                    var url = 'http://localhost/dashboard/practice_project/php_server/login.php';
                    let obj = {
                        email: "t7878780@gamil.com",
                        name: "asddzxcc",
                        password: "asddzzxccca"
                    }
                    fetch(url,{
                        method: 'POST',
                        body: obj,}
                    )
                    .then(function (response) {
                      return response.text();
                    })
                    .then(function (body) {
                      console.log(body);
                    });
                }}>登入</button>
            </div>
        </>
    );
}

export default Login;
